INSERT INTO `categories` VALUES(1, 'Diet Program Coupons', 'Diet Coupons - Discount Diet Products, Meals, Affordable Diet Programs', 'Diet Coupons, Discount Diet Meals, Diet Plan, Diet Plans, Online Diets, Diet Weight Loss Coupons, Free Diet Coupons, Diet Coupon Codes, Free Shipping Codes, Free Shipping, Medifast, Diet To Go, South Beach Diet, Nutrisystem, eDiets - TopHealthspot.com', 'All Brand Name Diet Coupons from TopHealthSpot.com. Save on diet programs, diet products and meals, diet coupon codes &amp; free shipping for diet plans and weight loss supplements.', 1, 'TopHealthSpot.com makes weight loss easy and affordable. We are the #1 Source for Online Diet Coupons, Diet Coupon Codes and Free Shipping Promo Codes. Use any of TopHealthSpot''s current Diet Coupons on Brand Name Online Diets such as: Jillian Michaels, South Beach Diet, Alli Diet Plan, 5 Factor Diet...We have them all! Save on Discount Diet Products, Weight Loss Supplements and Prepared Meal Delivery Plans. We make shedding those extra pounds and inches our priority. Just choose the right Diet Plan or Diet Program that fits your lifestyle.');
INSERT INTO `categories` VALUES(2, 'Health &amp; Fitness Coupons', 'Health &amp; Fitness Coupons - Health &amp; Fitness Discounts', 'Health &amp;amp; Fitness Coupons, Fitness Coupons, Health Coupon Codes, Deals Health, Health &amp; Fitness Promotional Codes, Online Health and Fitness Coupons, Health and Fitness Online Discounts, Fitness Coupon Codes, Fitness Promo Codes - Tophealthspot.com', 'TopHealthSpot.com, Best online source for health &amp; Fitness Deals. 1,000''s of Health and Fitness Coupons, Discount Coupon Codes, Updated Daily for Brand Name Health &amp; Fitness Products.', 1, 'TopHealthSpot.com is the most comprehensive online source for Health &amp; Fitness Coupons. Our daily online deals, discounts and Health &amp; Fitness Codes save you money every time you shop online with us for Brand Name Health &amp; Fitness Products. \r\nYour Health &amp; Fitness is an important part of your life. Trust TopHealthSpot to bring you great quality &amp; value from top retailers like Dick''s Sporting Goods, Gaiam, Bowflex, 1-800-Contacts and so much more. Use any of TopHealthSpot''s Free Shipping Promo Codes and current online Health &amp; Fitness Coupons to get what you need conveniently delivered right to your door. ');
INSERT INTO `categories` VALUES(3, 'Bath &amp; Beauty Coupons', 'Bath &amp;  Beauty Coupons Codes - Discounts, Deals - TopHealthSpot.com', 'Beauty Coupon Codes, Beauty Coupons, Discount Beauty Products, Discount Make Up Coupons, Free Beauty Coupon Codes, Free Bath &amp;amp;amp; Beauty Coupon, Beauty Promo Codes, Bath &amp; Beauty Coupons - TopHealthSpot.com', 'Brand Name Bath &amp; Beauty Coupon Codes, Discounts, Beauty Promo Codes, Free Shipping Offers on Bath, Beauty and Skin Care Products at TopHealthSpot.com', 1, 'TopHealthSpot.com is your #1 Source for Bath &amp; Beauty Coupons, Skin Care Coupon Codes and Free Sample Gifts! Shop online for a comprehensive selection of Brand Name Cosmetics, Bath &amp; Spa Essentials, Anti Aging Skin Care as well as Organic Make-Up and well known Beauty Products...and so much more. \r\nUse any on of TopHealthSpot''s current Beauty Promo Codes, Bath &amp; Beauty Coupon Codes or Free Shipping offers to have all of your favorite Bath &amp; Beauty Products conveniently delivered to your door!');
INSERT INTO `categories` VALUES(4, 'Pet Health Coupons', 'Pet Health Coupons - Pet Pharmacy, Coupon Codes, Pet Meds - TopHealthSpot.com', 'Pet Health Coupons, Pet Health Coupon Codes, Pet Care Coupons, Pets, Pet, Pet Pharmacy Coupons, Pet Health Discounts, Pet Supply Coupons, Pet Supplies, Pet Pharmacy Coupon Codes, Discount Pet Health Products, Advantage, Frontline, Pet Meds - TopHealthSpot.com', 'Get rock bottom prices on Brand Name Pet Meds, Pet Supplies, Pet Health Coupons for Advantage, Revolution, Heart Guard, Pet Pharmacy Products at TopHealthSpot.com', 1, 'Only the best for our best friends - whether they are furry, feathered or have scales, TopHealthSpot.com is the largest online source for Brand Name Pet Health &amp; Wellness, Pet Meds, Pet Supplies, Pet Toys &amp; Accessories. Be assured you are getting top quality &amp; value at rock bottom, online discounted prices. Use any of TopHealthSpot''s Pet Health Coupons, Pet Care Coupons and Free Shipping Promo Codes to get all of your Pet Products shipped conveniently to your door.');
INSERT INTO `categories` VALUES(5, 'Green &amp; Natural Coupons', 'Green Coupons - Green &amp; Natural Products for Home &amp; Personal Care', 'Green &amp; Natural Coupons, Organic, Green, Natural Products, Organic Products, Green Home Products, Eco-Friendly, Eco-Conscious, Environmentally Friendly, Natural, Chemical Free, 100 Percent Natural - TopHealthSpot.com', 'Green &amp; Natural Coupon Codes, Shop for Organic Beauty, Health, Home, Garden Products, Natural Pet Supplies at TopHealthSpot.com', 1, 'TopHealthSpot.com Green &amp; Natural Coupons Section is for those that are looking for the best online source of Green &amp; Natural Products with a big emphasis on health, wellness and personal well being. Choose from Brand Name Green &amp; Natural Products for your Personal Home, Green Baby Essentials, Holistic Pet Health, Health &amp; Fitness Products. Our Green &amp; Natural Coupons save you money everyday when you shop any of our well known Green &amp; Natural stores. \r\nGet Free Online Green Coupons and Free Shipping Offers for all the best quality &amp; value eco-conscious products that are sure to change your life and make our planet a cleaner, greener place to be.');
INSERT INTO `categories` VALUES(6, 'Men''s Health Coupons', 'Men''s Health Coupons - Men''s Health - Discount Coupon Codes - TopHealthSpot.com', 'Men''s Health Coupons, Men''s Health Coupon Codes, Men''s Health Promo Codes, Men''s Health Deals, Men''s Health Promotional Codes, Best Men''s Health Deals, Men''s Health Products, Grooming Products, Men''s Health Discounts, Men''s Skin Care - TopHealthSpot.com', 'Best Brand Name Men''s Health Coupons, Men''s Deals &amp; Discounts on Health &amp; Fitness, Men''s Grooming products. Best selection, quality, value at TophealthSpot.com', 1, 'TopHealthSpot is your Best Online Source for Men''s Health Coupons, Men''s Health Coupon Codes and all Free Shipping Coupons. We carry the most comprehensive selection of quality, Brand Name Men''s Health Products, Men''s Vitamins &amp; Supplements as well as Men''s Skin Care and Grooming Products such as Lab Series, Clarins Men and The Grooming Lounge. Our Men''s Section will quickly become your go to place for all your favorite Health &amp; Fitness needs. Use any of TopHealthSpot''s current Men''s Health Promo Codes and Free Shipping offers to get what you need conveniently delivered to your door!');
INSERT INTO `categories` VALUES(7, 'Senior Health Coupons', 'Senior Health Coupons - Senior Discounts for Health &amp; Wellness', 'Senior Health, Seniors Health, Senior Health Coupons, Senior Health Coupon Codes, Health Products for Seniors, Support and Mobility, Health Products, Diet Supplements, Seniors Home Health Care Products, Anti-Aging Coupons, Anti Aging Skin Care - TopHealthSpot.com', 'Save up to 40% on Brand Name Senior Health Coupons Senior Health Products, Anti Aging Skin Care, Vitamins, Home Health Care Products. Best Source for Seniors Health at TopHealthSpot.com', 1, 'TopHealthSpot.com is the largest online source of Senior Health &amp; Wellness Products, Home Medical Supplies, Senior Fitness Solutions as well as Personal Health Products and Anti Aging Skin Care and Supplements. \r\nSave money &amp; time by shopping online with us for a great selection of Brand Name Health &amp; Wellness Products. Just use any of TopHealthSpot''s current Senior Health Coupons, Senior Discounts, Online Deals &amp; Free Shipping Coupons to get what you need conveniently delivered right to your door.');
INSERT INTO `categories` VALUES(8, 'Mother &amp; Child Coupons', 'Baby Health Coupons, Maternity Health Coupons, Everything for mother &amp; baby', 'Baby Health Coupons, Baby Coupon Codes, Maternity Health Coupons, Discounts, Maternity Coupon Codes, Pregnancy Health Products, Baby Products, Baby Product Coupons, Diaper Coupons, Diaper Coupon Codes, Prenatal Vitamin Coupons, Green Baby Products - TopHealthSpot.com', 'Best source, Natural, Organic Health Baby Products for Mother &amp;amp;amp; Child. Everything from Organic Baby Bedding to Prenatal Vitamins at TopHealthSpot.com', 1, 'Nothing but the best for mom and her baby. TopHealthSpot.com offers a comprehensive line of Natural &amp; Organic Health Products geared towards your baby''s needs as well as your own. Shop online with our Maternity Health Coupons, Discount Baby Coupon Codes to get the best price on Green Diapers, Natural Baby Bedding, Prenatal Vitamins and Brand Name Health Products delivered right to your door. Trust TopHealthSpot.com for quality &amp; value on well known Baby and Maternity Products. Use our Free Shipping Coupons to get all your maternity and baby essentials conveniently delivered to your door.');
INSERT INTO `categories` VALUES(9, 'Women''s  Health Coupons', 'Women''s Health Coupons - Women''s Health Coupon Codes, Women''s Health Deals at TopHealthSpot.com', 'Women''s Health Coupons, Women''s Health Coupon Codes, Women''s Health Promo Codes, Women''s Health Deals, Women''s Health Promotional Codes, Best Women''s Health deals, Women''s Health Products, Women''s Health Discounts, Women''s Products - TopHealthSpot.com', 'Best Brand Name Women''s Health Coupons, Women''s Deals &amp; Discounts on Health &amp; Fitness, Women''s Essentials. Best selection, quality, value at TopHealthSpot.com', 1, 'TopHealthSpot.com is your Best Online Source for Women''s Health Coupons, Women''s Health Coupon Codes and all Free Shipping Coupons. We carry the most comprehensive selection of quality, Brand Name Women''s Health Products, Women''s Vitamins &amp; Supplements as well as Health &amp; Fitness Essentials designed specifically for a woman''s needs. Our Women''s Health Section will quickly become your go to place for all your favorite Health &amp; Wellness concerns. Use any of TopHealthSpot''s current Women''s Health Promo Codes and Free Shipping Offers to have what you need conveniently delivered right to your door. ');
INSERT INTO `categories` VALUES(10, 'Vitamin Coupons', 'Vitamin Coupons, Vitamin Shoppe Coupons, Vitamin Deals - TopHealthSpot.com', 'Vitamin Coupons, Vitamins and Supplements Discounts, Vitamin Coupon Codes, Coupon Code, Vitamin Shoppe Coupons, Vitamin Shoppe Coupon Code, Discount Vitamins, Promo Code, Promotional Code, Promo - TopHealthSpot.com', 'Save up to 50% or more on Brand Name Vitamins &amp; Supplements, Best Selection of Vitamin Coupons, Discounts, Vitamin Shoppe Coupons at TopHealthSpot.com', 1, 'Looking for the best selection of quality, Brand Name Vitamins at the very lowest discount price, you''ve arrived at the right page! Take advantage of TopHealthSpot''s current Brand Name Vitamin Coupons, BOGO Deals and Vitamin Coupon Codes to stock up on all of your Vitamins, Supplements and Herbal Remedies. Check out these great Vitamin Deals and Free Shipping Coupons.');
INSERT INTO `contents` VALUES(2, 'About Us', 'About Us - TopHealthSpot.com', 'TopHealthSpot.com', 'About  Us -TopHealthSpot.com', '<p>TopHealthSpot was created in 2006. We are the original &ldquo;niche&rdquo; Health Coupons site. Out main focus is on Health and Wellness Products that promote a healthy lifestyle. Our marketing team tirelessly&nbsp; search out only the best value and discount deals, saving our customers valuable time and money.</p>\r\n<p>We strive to create an online shopping experience for Brand Name Products that will have a big impact on your quality of life.</p>\r\n<p>At TopHealthSpot, we are committed to keeping you well informed on the most trusted Nutritional Vitamins, Supplements, Bath &amp; Beauty Products, Natural &amp; Green, and Eco-Conscious Solutions, plus so much more&hellip;</p>\r\n<p>TopHealthSpot offers exceptional value with 1,000&rsquo;s of Health Coupons, Discount Coupon codes and Free Shipping Offers that are updated everyday.</p>\r\n<p>Online Shopping allows savvy consumers to shop at their leisure within the comfort and privacy of home on a secure network.</p>\r\n<p>TopHealthSpot has the most comprehensive selection of Health Minded Retailers, all with a 100% Customer Satisfaction Rating.</p>\r\n<p>We thank you for visiting TopHealthSpot and taking the time to find out &ldquo;About Us.&rdquo; We realize that there are thousands of Coupon sites on the internet today, so we welcome your patronage and look forward to providing you with our personalized, quality service.</p>\r\n<p><strong>TopHealthSpot.com</strong></p>');
