INSERT INTO `contents` VALUES(4, 'Frequently Asked Questions (FAQ''s)', 'Frequently Asked Questions, FAQ, Online Coupons, Coupon Codes, Online Shopping, Discount Coupon Codes, Free Shipping Coupons, Tophealthspot.com.', 'How To Save Money Online using Discount Coupon Codes, Free Coupons and Free Shipping offers at TopHealthSpot.com.', 'Frequently Asked Questions - FAQ''s, Save Money With Online Coupons - TopHealthSpot.com', '<p><strong><span style="color: #ff6600;">How To Save Money Using Online Coupons</span></strong></p>\r\n<p><span style="color: #99cc00;">"Online Coupons" are discounts that are offered to online shoppers from Online Merchants or Retailers. Online Coupon Codes, Free Shipping Offers and Percentage Off Coupon Deals are all typical phrases that pertain to "online coupons."</span></p>\r\n<p><strong><span style="color: #ff6600;">Q. What Type Of Online Coupons Are There?</span></strong></p>\r\n<p><span style="color: #99cc00;"><strong>A. </strong>There are three types of Online Coupons that we use on TopHealthSpot.com</span></p>\r\n<p><strong><span style="color: #ff6600;">"Banner Ads"</span> </strong><span style="color: #99cc00;">that are located throughout the site. These banners are sales, discounts, BOGO Offers or Percentage Off Ads. Just simply click on the merchant banner and follow through to "checkout" to receive the current offer. </span></p>\r\n<p><strong><span style="color: #ff6600;">"Link Based Coupons"</span> </strong><span style="color: #99cc00;">Simply click on the link to the merchant using the Tophealthspot link and the discount will be automatically applied at checkout.</span></p>\r\n<p><strong><span style="color: #ff6600;">"Code Based Coupons"</span> </strong><span style="color: #99cc00;">Simply choose the item you would like to purchase, enter the Coupon Code at&nbsp;checkout. You can do this easily, just follow&nbsp;these simple steps:</span></p>\r\n<p><span style="color: #99cc00;">1. Choose the Coupon Code for the item you&nbsp;would like to purchase.&nbsp;<br />2. Copy (ctrl + c) or write down the Coupon Code<br />3. Click the merchant link on TopHealthSpot. *Note: A new browser window will open to the merchants website.<br />4. It is a good idea to shop around for other "Great Discount Deals" in this newly opened window before entering all Coupon Codes at checkout.<br />5. Enter the Coupon Code extacly as it appears on TopHealthSpot<br />6. At&nbsp;checkout, verify to see that the Coupon Code discount has been applied to your oder and complete purchase.<br />7. Enjoy your great products when they arrive!</span></p>\r\n<p>&nbsp;<strong><span style="color: #ff6600;">Q. Is there a fee to shop with TopHealthSpot.com?</span></strong></p>\r\n<p><span style="color: #99cc00;"><strong>A. </strong>No. TopHealthSpot.com is totally frre. We do our customers a great service by providing the most comprehensive selection of health &amp; wellness products with the lowest published price in the form of online coupons and discount deals.</span></p>\r\n<p><strong><span style="color: #ff6600;">Q. Do I Need An Account To Shop With TopHealthSpot?</span></strong></p>\r\n<p><span style="color: #99cc00;"><strong>A. </strong>No, there is no need to register or share personal information. </span></p>\r\n<p><strong><span style="color: #ff6600;">Q. Does TopHealthSpot Have A Newsletter? Is there a way to get current coupon deals?</span></strong></p>\r\n<p><span style="color: #99cc00;"><strong>A. </strong><a href="#">Yes. TopHealthSpot offers Health Tips, Product Reviews and hot Coupon Deals through our newsletter. <br /></a></span></p>\r\n<p><span style="color: #99cc00;">Thank you for shopping with TopHealthSpot.com! If you have any questions or problems with any special offers, please contact us immediately. We value your patronage and are here to help you experience the best online shopping experience while providing you with the best value and discounts. </span></p>');
INSERT INTO `contents` VALUES(5, 'Privacy Policy', 'privacy, policy', 'Privacy Policy', 'Privacy Policy', 'Wednesday, 30 July 2008, By Administrator&nbsp;&nbsp; &nbsp;<br /><br />Privacy Policy<br /><br />At TopHealthSpot.com, we realize the importance of feeling safe online and are fully committed to ensuring that your privacy is respected and protected.<br /><br />Please feel free to sign up for our newsletter, special offers, discount coupons or any other monthly promotions with complete confidence secure in the fact that we will never trade email list or share any personal information that has been shared with Tophealthspot.com.<br />&nbsp;<br />A word about cookies<br />&nbsp;<br />Our site uses a feature of your browser to set a "cookie" on your computer. Cookies are small packets of information that a site''s computer stores on your computer. At Tophealthspot. we can then read the cookies whenever you visit the Tophealthspot website.. We use cookies to save your password so you don''t have to re-enter it each time you visit our site, to deliver content specific to your interests, to track the pages you''ve visited and to make sure you don''t see the same ads repeatedly. These cookies allow us to use the information we collect to customize your Tophealtspot experience so that your visit to Tophealthspot.com is as relevant and as valuable to you as possible.<br />&nbsp;<br />How TopHealthSpot.com uses Information it collects<br />&nbsp;<br />Tophealthspot uses the information you provide for several purposes, such as to communicate with you and to give you a better experience when visiting the Tophealthspot.com website by personalizing tools, content, services and email messages. Tophealthspot also uses this information to build new services and develop offers that we believes are more relevant and valuable to you.<br />&nbsp;<br />Third Party Advertising and Links to other Sites.<br />&nbsp;<br />The Tophealthspot website contains links to advertiser and affiliate websites that are not co-branded or affiliated with Tophealthspot.com in any way. We cannot be responsible for the privacy practices or the content of such websites, and we do not control the practices of any of our advertisers or partners to whose sites we link.We do however still guarantee that all transactions are completed through the safest practices available to websites today and that we do not knowingly forward any personal information onto third parties.<br />&nbsp;<br />How we protect and secure your information<br />&nbsp;<br />At Tophealthspot.com we have numerous security measures in place to protect you from the loss, misuse and alteration of the information under our control, All of your member information require use of your password. We recommend that you do not share your password with anyone. Tophealthspot.com uses industry-standard tools, such as firewalls, to ensure that your information is secure and confidential.<br /><br />Should you have any further questions about our privacy policy please contact us.<br /><br />');
INSERT INTO `contents` VALUES(6, 'Terms & Conditions', 'terms', 'Top Health Spot - Terms and Conditions', 'Terms', '<p>Last Updated: 12/29/09</p>\r\n<p>&nbsp;</p>\r\n<p>The terms and conditions contained below govern the use of the website GS Enterprises LTD. ("Tophealthspot.com"). If you do not agree to the terms an= d conditions set forth below, please do not use the website or any informatio= n contained therein. By using the website and/or the information contained therein you agree to the terms set forth below. By using this site, you signify your agreement to these terms and conditions and privacy policy.</p>\r\n<p>Please review this agreement periodically as we reserve the right to make modifications effective immediately and constitutes your acceptance of such changes. We reserve the right to deny, restrict, suspend any users use of the site at any such time for failure to abide by this agreement. This also applies to affiliates, licensees and advertisers.</p>\r\n<p>&nbsp;</p>\r\n<p>Use of Site. All offers and promotions on this site are subject to change without notice. The Health Coupon Site known as Tophealthspot.com provides you, our visitors, a venue for obtaining the information contained in this site and has no control over the legality of any coupons, discounts or any other offers made by vendors an or affiliate merchants, the ability of any of the vendors to complete the sales in accordance with the offers, or the quality of the goods offered by the vendors. Tophealthspot.com has no control over whether vendors will honor the offers shown on this site and does not guarantee the accuracy or completeness of the information containe= d on this site. In the event you have a dispute with a vendor in any way relating to this site or the use of information from this site, you agree t= o waive and release Tophealthspot.com from any and all claims, demands, actions, damages (actual and consequential), losses, costs or expenses of every kind and nature, known