0003&amp;type=3&amp;subid=0" target="_new">Diet Like a Celebrity: Get a fantastic body in 5 weeks!</a><br />Diet Like a Celebrity: Get a fantastic body in 5 weeks! Start now with 5 free diet tips!', 12, 12, '5 Factor Diet Coupons', '5 Factor Diet, 5 Factor Diet Coupons, Coupon Codes, TopHealthSpot.com', 'Find 5 Factor Diet Coupons, Coupons Codes and discounts at TopHealthSpot.com');
