INSERT INTO `stores` VALUES(29, 'The Grooming Lounge Coupons', '<p><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017618345&amp;pubid=21000000000106305" target="_new"><img src="http://clickserve.cc-dt.com/link/tplimage?lid=41000000017618345&amp;pubid=21000000000106305" border="0" alt="Grooming Lounge - Men''s Grooming Products and Advice" /></a> <br /><br /><strong>Grooming Lounge</strong><br /><br /><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017615985&amp;pubid=21000000000106305" target="_new">The Grooming Lounge</a> is the country''s premiere destination for quality men''s grooming products and services. Whether a man is looking for a new shaving regimen, a hair product, a skincare solution or a way to deal with an embarrassing problem, the Grooming Lounge can help.<br /><br />The Grooming Lounge was launched in 1999 by Michael Gilman &amp; Pirooz Sarshar, two individuals with a lifetime of experience in the men''s grooming industry (Gilman grew up in the cosmetic product distribution business and Sarshar has been a barber since the age of 16). After serving as the "un-official grooming gurus/suppliers" to their regular-guy buddies for years, the duo decided to make it official by creating a grooming brand incorporating stores, a web site, a catalog and custom-blended grooming products. Above all, Michael and Pirooz want to set a new standard in the industry by making men feel "like kings" via the best in customer and technical service.<br /><br />When it comes to products, The Grooming Lounge only offers the "best of the best." They figure that most guys don''t want to sort through 30 or more shaving creams before settling on a selection. So, instead of showcasing every product under the sun, they decided to offer only items that deliver the maximum results for each individual grooming need or challenge. <br /><br /> The Grooming Lounge: <a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000024778314&amp;pubid=21000000000106305" target="_new">Lab Series Skincare for Men.</a><br /><br />The Grooming Lounge: <a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000024778344&amp;pubid=21000000000106305" target="_new">The Mangroomer - Do-It-Yourself electric back hair shaver</a><br />Do-It-Yourself electric back hair shaver is the best tool for hiding a furry back since the T-shirt. Its slick design opens up to 135 degrees, allowing you to easily reach all parts of the back and shoulders.<br /><br />The Grooming Lounge: <a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017608803&amp;pubid=21000000000106305" target="_new">Mens Anti-Aging Products</a><br />Grooming Lounge - Mens Anti-Aging Products!<br /><br /><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017616152&amp;pubid=21000000000106305" target="_new"><img src="http://clickserve.cc-dt.com/link/tplimage?lid=41000000017616152&amp;pubid=21000000000106305" border="0" alt="The Grooming Lounge" /></a><br /><br />The Grooming Lounge: <a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017609460&amp;pubid=21000000000106305" target="_new">Thinning Hair Solutions for Men.</a><br />Thinning Hair Solutions for Men at Grooming Lounge.<br /><br /><br /><br /><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000017616876&amp;pubid=21000000000106305" target="_new"><br /></a></p>', 'This is a brief description for this store, it should be short and to the point, highlighting the key aspects of their product lines.. Try to avoid links or other HTML tags in this section..', 'The Grooming Loung Coupons - Coupon Codes and Promotions - TopHea', 'http://clickserve.cc-dt.com/link/tplclick?lid=41000000017615985&pubid=21000000000106305', 'Groominglounge.com, The Grooming Lounge Coupons, Coupon Codes, Men''s Grooming Products, Men''s Skin Care, Men''s Skin Care Coupons, Discounts, Promotional Offers, promo, TopHealthSpot.com', 'Find the best Grooming Lounge Coupons, Coupon Codes and promotions at Top