INSERT INTO `stores` VALUES(34, 'BORBA - Drinkable Skin Care', '<a href="http://www.shareasale.com/r.cfm?b=141287&amp;u=187834&amp;m=9626&amp;urllink=&amp;afftrack=" target="_new"><img src="http://www.shareasale.com/image/Drink-Yourself-Beautiful-CRY-5.gif" border="0" alt="" width="248" height="164" /></a><br /><br /><strong>BORBA - HEALTHY SKIN FROM WITHIN</strong> <strong>- HEALTH AND BEAUTY PRODUCTS</strong><br /><br /><a href="http://www.shareasale.com/r.cfm?b=52030&amp;u=187834&amp;m=9626&amp;urllink=&amp;afftrack=" target="_new">BORBA&rsquo;s</a> beauty philosophy is something you feel from within. BORBA understands that much of what we do on the outside will affect how we feel on the inside, and that the key to true beauty is found in the right melding of the inner and outer person. BORBA also realizes that the same inner and outer fusing is true for skin and its overall health and appearance&hellip; hence BORBA Nutraceuticals and Cosmeceuticals were developed to work with your unique body''s chemistry.<br /><br /><br /><strong>BORBA NUTRACEUTICALS...FOR YOUR SKIN''S INNER NEEDS</strong><br />BORBA Nutraceuticals include Skin Balance Waters, Aqua-less Crystalline (the powdered versions of the waters), and Confections which provide skin nutrition and support for skin&rsquo;s inner needs. These products are unprecedented in their approach to skin care. Why? Rather than treating just the &ldquo;symptoms&rdquo; or &ldquo;problems&rdquo; that are seen on skin&rsquo;s surface--as with other traditional skincare programs, BORBA formulated convenient, mobile, and highly nutritional ingestibles to target the inner causes of skin&rsquo;s problems throughout the entire body, allowing skin to condition and improve itself from within.<br /><br /><strong>BORBA COSMECEUTICALS...FOR YOUR SKIN''S OUTER NEEDS</strong><br />BORBA Cosmeceuticals are next generation topical skin care products that incorporate another first in skin treatment - Fiber-Knit Technology. Skin is literally surrounded with nutrient-infused ingredients and natural fibers which are specifically formulated to work with your body&rsquo;s unique daily changing chemistry to provide visible skin-improving results. BORBA&rsquo;s &ldquo;first-of-its-kind&rdquo; Fiber-Knit Technology creates a natural, web-like protection on the skin, while allowing active ingredients to penetrate and significantly improve skin&rsquo;s deepest epidermal layers.<br /><br />When BORBA Cosmeceuticals and Nutraceuticals are used together, skin&rsquo;s inner and outer needs are fused. Moreover, all of BORBA&rsquo;s products are dermatologist tested and recommended.<br /><br /><a href="http://www.shareasale.com/m-pr.cfm?merchantID=9626&amp;userID=187834&amp;productID=457354884" target="_new"><img src="http://borba.net/product_images/ac_skin_calming_30.jpg" border="0" alt="" /></a><br /><br /><strong>BORBA Skin Balance Skin Calming Aqualess Crystalline (30 Day)</strong><br /><br />BORBA: <a href="http://www.shareasale.com/r.cfm?b=52030&amp;u=187834&amp;m=9626&amp;urllink=&amp;afftrack=" target="_new">BORBA luxury skin care products.</a> <br />Skin balance water, anti-oxidant cleansers, complexion &amp; wrinkle repair, eye creams and more at Borba.com.<br /><br /><strong>BORBA Total Replenishing Skin Care System</strong><br /><br /><br />BORBA: <a href="http://www.shareasale.com/r.cfm?b=53781&amp;u=187834&amp;m=9626&amp;urllink=&amp;afftrack=" target="_new">Borba.com - Skin balance water for healthy skin.</a><br />The entire line of BORBA Skin Balance Water combines the vitamins, nutrients, and minerals found in skin care products with the naturally rejuvenating, hydrating power of water. BORBA Skin Balance Water is formulated to work with your body''s chemistry to promote Healthy Skin from Within. This on-the-go, skin care-infused beverage combines simplicity and nutrition with the goodness of water - all without calories, carbs, fat, or sodium.<br />It''s the water with benefits.<br /><br /><a href="http://www.shareasale.com/m-pr.cfm?merchantID=9626&amp;userID=187834&amp;productID=457354907" target="_new"><br /></a>', 'This is a brief description for this store, it should be short and to the point, highlighting the key aspects of their product lines.. Try to avoid links or other HTML tags in this section..', 'Borba Coupons - Borba Coupon Codes - Borba Drinkable Skin Care -', 'http://www.shareasale.com/r.cfm?b=52030&u=187834&m=9626&urllink=&afftrack=', 'Borba.com, Borba Coupons, Borba Coupon Codes, Promotions, Borba Drinkable Skin Care, TopHealthSpot.com', 'Find Borba coupons and coupon Codes at TopHealthSpot.com. BORBA Drinkable Skin Care.');
