INSERT INTO `stores` VALUES(41, 'BuyGreen.com ', '<a href="http://www.shareasale.com/r.cfm?b=94240&amp;u=187834&amp;m=14061&amp;urllink=&amp;afftrack=" target="_new"><img title="Buygreen.com" src="http://www.buygreen.com/images/assets/logo-buygreen.gif" border="0" alt="Buygreen.com" /></a><br /><br /><strong>BuyGreen.com</strong><br /><br />Our mission at <a href="http://www.shareasale.com/r.cfm?b=94240&amp;u=187834&amp;m=14061&amp;urllink=&amp;afftrack=" target="_new">BuyGreen</a> is to become your most trusted source for green products, offering the widest variety of quality products, the best information for consumers, and the most enjoyable shopping experience. <br /><br /><strong>History</strong><br />We created this site in response to our own search for earth-friendly products.&nbsp; Like you, we want to buy products that are better for our families and our planet.&nbsp; As we have discovered however, finding green products and understanding what if anything makes them green can be challenging and time consuming.<br /><br />We believe that there is a better way to buy green products.&nbsp; At BuyGreen, we want to provide the best possible buying experience by offering a wide range of products, the tools you need to understand why a product qualifies as ''green'', and superior customer service.&nbsp; Our goal is for BuyGreen to be your primary destination for green products, services, and green living information.<br /><br /><strong>How Green Are We</strong><br />At BuyGreen, we are dedicated to developing a sustainable business.&nbsp; In every aspect of our operations, from product shipment to office supplies, we look to reduce waste, conserve energy, and minimize use of resources.&nbsp; After reducing our carbon footprint as much as possible through these efforts, we purchase carbon offsets to reach our goal of a zero waste footprint.&nbsp; We are approved by Co-Op America, give 1% of our sales back to environmental causes through One Percent for the Planet, and support various environmental and social causes closer to home.', 'This is a brief description for this store, it should be short and to the point, highlighting the key aspects of their product lines.. Try to avoid links or other HTML tags in this section..', 'BuyGreen.com - TopHealthSpot.com', 'http://www.shareasale.com/r.cfm?b=94240&u=187834&m=14061&urllink=&afftrack=', 'Buygreen.com, Buy Green', 'Buy Green');
