INSERT INTO `stores` VALUES(52, 'Yves Rocher ', '<p><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000011377948&amp;pubid=21000000000106305" target="_new"><img title="Yves Rocher Coupon" src="http://content.yvesrocherusa.com/images/header/yvesrocher_logo.jpg" border="0" alt="Yves Rocher Coupon" /></a><br /><br /><strong>Yves Rocher</strong><br /><br /><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000011377948&amp;pubid=21000000000106305" target="_new">Yves Rocher</a> is the World Leader in Botanical Beauty care. Nature is the source of beauty. Yves Rocher was already convinced of this over 40 years ago, when he created the brand that bears his name. That event changed everything: it marked the beginning of natural, accessible beauty ? beauty for every woman. Today, thanks to advances in plant biology, the Yves Rocher product line contains over 150 active plant ingredients. <br /><br />Yves Rocher researchers combine the rigorous discipline of science with their extensive knowledge of the plant world to develop new, high-performance cosmetics and offer women the latest breakthroughs in botanical cosmetic research. Since 1959, Yves Rocher has filed over 50 patent families. The brand continually innovates to satisfy women?s desires and beauty needs. It offers products for every woman at affordable prices.<br /><br />Yves Rocher is also committed to ethical practices: raw materials, formulas and packaging that are environmentally friendly, clean factories, and a Foundation that seeks to educate, protect and act on behalf of nature.<br /><br /><a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000016408340&amp;pubid=21000000000106305" target="_new"><img src="http://clickserve.cc-dt.com/link/tplimage?lid=41000000016408340&amp;pubid=21000000000106305" border="0" alt="Yves Rocher" /></a></p>\r\n<p>Yves Rocher: <a href="http://clickserve.cc-dt.com/link/tplclick?lid=41000000024550770&amp;pubid=21000000000106305" target="_new">Last Chance Shop: Yves Rocher Canada''s Biggest Discounts.</a><br />**The Last Chance Shop - a favorite spot for customers to find discontinued items and the last bits of inventory on some hard-to-find products and gifts. Visit often, as the selection changes weekly - from bronzing lotion to body wash.**</p>', 'This is a brief description for this store, it should be short and to the point, highlighting the key aspects of their product lines.. Try to avoid links or other HTML tags in this section..', 'Yves Rocher', 'http://clickserve.cc-dt.com/link/tplclick?lid=41000000011377948&pubid=21000000000106305', 'Yvesrocher.com, ', 'Yves Rocher');
