INSERT INTO `stores` VALUES(62, 'Zeta Clear - Nail Fungus Relief ', '<p><a href="http://www.zetaclear.com/?aid=122853" target="_new"><img style="float: left;" src="http://media.markethealth.com/ads/222222-230-1192839794-zetaclear_logo.jpg" border="0" alt="ZetaClear - Nail Fungus Relief" width="200" height="117" /></a> <br /><br />You deserve clear, healthy looking nails. <br /><br />The fact is, is over 11 million people suffer from brittle, discolored finger nails and toe nails, yet few people truly know the facts, myths and real cure when it comes to ending embarrassing nail fungus. <br /><br />There are hundreds of nail fungus products on the market today and most have no real effect on curing nail fungus. <a href="http://www.zetaclear.com/?aid=122853" target="_new">ZetaClear</a> is an all-natural, homeopathic solution, specifically formulated to treat the underlying cause of insightly nails.<br /><br /><a href="http://www.zetaclear.com/?aid=122853" target="_new"><img src="http://media.markethealth.com/ads/222222-230-1193253807-120x60-2.gif" border="0" alt="ZetaClear - Nail Fungus Relief" /></a> <br /><br />There is a solution for your nail fungus! ZetaClear attacks the problem in two ways. First, with a unique, topical medicine coupled with an oral, homeopathic fungus relief spray. This two-step process has been used by doctors for years. The all-natural ingredients used in ZetaClear treat a wide variety of symptoms associated with nail fungus. Since each case is unique, these powerful ingredients enter your bloodstream quickly and work from the inside out.<br /><br />Please don''t wait another day, start on your own path to healthy, vibrant nails!</p>', 'This is a brief description for this store, it should be short and to the point, highlighting the key aspects of their product lines.. Try to avoid links or other HTML tags in this section..', 'Zeta Clear - ZetaClear, Nail Fungus Relief - TopHealthSpot.com', 'http://www.zetaclear.com/?aid=122853', 'Zetaclear.com, Zeta Clear, ZetaClear, Nail Fungus, Nail Fungus Treatment, All Natural Nail Fungus Treatments, Yellow Nails,  TopHealthSpot.com', 'Zeta Clear');
