="new">Penaten Baby Powder</a> - 100g powder, $6.50.<br />Ideal to care for damaged and worn skin around the diaper area, this powder removes moisture for very sensitive skin.  <br /><br /> <a href="http://click.linksynergy.com/fs-bin/click?id=7wO2pj3jQ/M&amp;subid=&amp;offerid=13308.1&amp;type=10&amp;tmpid=2965&amp;RD_PARM1=http%253A%252F%252Fwww.smallflower.com%252Fpenaten%252Fsensitive-moisturizing-wipes-56-wipes.html" target="new">Sensitive Moisturizing Wipes</a> - 56 wipes, $8.50.<br />These fragrance-free wipes contain Penaten baby lotion for moisturizing protection, specially designed for the sensitive skin of a newborn. Can be used on the face and eye areas, but also anywhere on the body. <br /><br /> <a href="http://click.linksynergy.com/fs-bin/click?id=7wO2pj3jQ/M&amp;subid=&amp;offerid=13308.1&amp;type=10&amp;tmpid=2965&amp;RD_PARM1=http%253A%252F%252Fwww.smallflower.com%252Fpenaten%252Fgood-night-bath-500-ml-bubble-bath.html" target="new">Good Night Bath</a> - 500ml bubble bath, $19.25.<br />Soothing and relaxing lavender oil in a gentle bubble bath for babies, will have yours fast asleep, and clean.  <br /><br /> <a href="http://click.linksynergy.com/fs-bin/click?id=7wO2pj3jQ/M&amp;subid=&amp;offerid=13308.1&amp;type=10&amp;tmpid=2965&amp;RD_PARM1=http%253A%252F%252Fwww.smallflower.com%252Fpenaten%252Fsoothing-naturals-intensive-cream-100-ml-cream.html" target="new">Soothing Naturals Intensive Cream</a> - 100ml cream, $10.95.<br />With Vitamin E and Olive Oil Extract, Penaten''s Soothing Naturals Intensive Cream is the perfect remedy for your baby''s (or your own) dry skin. <br /><br /> <a href="http://click.linksynergy.com/fs-bin/click?id=7wO2pj3jQ/M&amp;subid=&amp;offerid=13308.1&amp;type=10&amp;tmpid=2965&amp;RD_PARM1=http%253A%252F%252Fwww.smallflower.com%252Fpenaten%252Fpenaten-baby-soap-100-g-bar.html" target="new">Penaten Baby Soap</a> - 100g bar, $3.25.<br />This gentle, moisturizing soap is enriched with lotion and honey to moisturize the skin 